import React, { useState } from "react";

import { Form, Button } from "react-bootstrap";

const MyForm = ({ saveChanges }) => {
  const [name, setName] = useState("");
  const [inn, setInn] = useState("");
  const [ogrn, setOgrn] = useState("");
  const [date, setDate] = useState("");
  const [adrress, setAdrress] = useState("");
  const [isOpen, setOpen] = useState(true);

  // const handleClickSubmit = (event) => {
  //   event.preventDefault();
  //   setOpen(!isOpen);
  //   handleClickSaveSubmit(name, inn, ogrn, date, adrress);
  //   console.log("myForm", name, inn, ogrn, date, adrress, isOpen);
  // };

  return (
    <Form onChange={saveChanges}>
      <Form.Group className="mb-3" controlId="formBasicEmail">
        <Form.Label>Name</Form.Label>
        <Form.Control
          type="text"
          placeholder="Enter name"
          value={name}
          onChange={(event) => {
            setName(event.target.value);
          }}
        />
        <Form.Label>INN</Form.Label>
        <Form.Control
          type="text"
          placeholder="Enter INN"
          value={inn}
          onChange={(event) => {
            setInn(event.target.value);
          }}
        />
        <Form.Label>OGRN</Form.Label>
        <Form.Control
          type="text"
          placeholder="Enter OGRN"
          value={ogrn}
          onChange={(event) => {
            setOgrn(event.target.value);
          }}
        />
        <Form.Label>Date of registarion</Form.Label>
        <Form.Control
          type="date"
          placeholder="Enter date of registarion"
          value={date}
          onChange={(event) => {
            setDate(event.target.value);
          }}
        />
        <Form.Label>Adrress</Form.Label>
        <Form.Control
          type="text"
          placeholder="Enter adrress"
          value={adrress}
          onChange={(event) => {
            setAdrress(event.target.value);
          }}
        />
      </Form.Group>
    </Form>
  );
};

export default MyForm;
